import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import Services from './Services';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Home({logout}) {
  return (
    <div>
      
      <HeroSection />
      <Cards />
      <button onClick={logout}>Logout</button>
     
    </div>
  );
}

export default Home;
